            </SectionTitle>
            <CenteredText>Lorem ipsum dolor sit amet consectetur adipiscing elit sodales primis, mollis viverra conubia ligula inceptos laoreet.</CenteredText>
            </SectionHeaderContainer>
            <ArticleSlider />
        </GraySection>
    );
}

export default LastestArticles;
